import React from 'react'
import { MDBDatePickerV5 } from 'mdbreact'

class DatePickerPage extends React.Component {
    render() {
        return (
            <div>
                <MDBDatePickerV5
                    disableFuture
                    getValue={(e) => console.log(e)}
                />
                <MDBDatePickerV5
                    disableFuture
                    inline
                    getValue={(e) => console.log(e)}
                />
            </div>
        )
    }
}

export default DatePickerPage
